using System;\nusing System.Collections.Generic;\n\nclass Program\n{\n    static void Main()\n    {\n        Dictionary<string, string> headers = new Dictionary<string, string>();\n\n        // Example of a very long string\n        string longKey = new string('X', 1024 * 1024); // A million characters\n\n        headers.Add("Value of X", "Some value");\n        headers.Add("Summary of Analyse & XYZ Reports", "Another value");\n        headers.Add(longKey, "Long key example");\n\n        Console.WriteLine(headers["Value of X"]);\n    }\n}